import React from "react";
import classes from "./TodoForm.module.css";

const TodoForm = () => {
  return (
    <div>
      <form>
        <input type="text" className={classes.inputTodo} />
        <button className={classes.addButton}>Add</button>
      </form>
    </div>
  );
};

export default TodoForm;
